package Week1.day2;

public class Factorial2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int factorial =1;
		
		for(int i=1; i<=5; i++) 
			factorial=factorial*i;
		{
			System.out.println("factorial of number 5 is " +factorial);
			
		}

}

}
